# uses infrastructure from ClassicalCipherCrackers, one of my personal projects
# https://github.com/qpwoeirut/ClassicalCipherCrackers


import random
from typing import Union, Tuple

from sympy import ImmutableMatrix

from ciphers.SubstitutionCipher import SubstitutionCipher
from crackers.ClimbingCracker import ClimbingCracker
from crackers.SubstitutionCracker import SubstitutionCracker


class CorCipher(SubstitutionCipher):
    def __init__(self, key: Union[str, int, Tuple[int, ...], ImmutableMatrix], iv: str):
        super().__init__(key)
        self.iv = iv

    def encrypt(self, plaintext: str) -> str:
        raise NotImplementedError()

    def decrypt(self, ciphertext: str) -> str:
        klen = len(self.key)
        pt = ""

        blocks = [ciphertext[i:i + klen] for i in range(0, len(ciphertext), klen)]
        for i, block in enumerate(blocks):
            block = self.subtract_blocks(block, self.key)
            prev_block = blocks[i - 1] if i > 0 else self.iv
            block = self.subtract_blocks(block, prev_block)
            pt += block
        return pt

    def subtract_blocks(self, block: str, key: str):
        ct_idxs = [(pt_a - k_a) % len(self.alphabet) for k_a, pt_a in
                   zip([self.alphabet.index(k) for k in key], [self.alphabet.index(pt) for pt in block])]
        return "".join([self.alphabet[idx] for idx in ct_idxs])


class CorCracker(ClimbingCracker, SubstitutionCracker):
    def __init__(self, alphabet: str, iv: str):
        ClimbingCracker.__init__(self, restart_threshold=200, iterations=250)
        SubstitutionCracker.__init__(self, alphabet)

        self.iv = iv

    def generate_random_key(self):
        return "".join(random.choices(self.alphabet, k=16))

    def mutate_key(self, key):
        idx = random.randint(0, len(key) - 1)
        return key[:idx] + random.choice(self.alphabet) + key[idx + 1:]

    def decrypt(self, key, ciphertext: str) -> str:
        return CorCipher(key, self.iv).decrypt(ciphertext)


def main():
    alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ"

    iv = 'RLNZXWHLULXRLTNP'
    ct = ''

    CorCracker(alphabet, iv).crack(ct)


if __name__ == '__main__':
    main()


